import React from "react";
import Address from "../../components/Address/Address";
import BasicDetail from "../../components/BasicDetail/BasicDetail";
import Drop from "../../components/Drop/Drop";
import Input from "../../components/Input/Input";
import "./profile.css";
const Profile = () => {
  return (
    <div className="profie_container">
      <div className="disclaimer">
        <h5>
          <em>
            * For School/College Fees Loan, Applicant must be parent/guardian
            with blood relation. Please don't fill the details of student in the
            profile details. Only for Career Enhancement Loans, students
            themselves can apply the loan, provided he/she is an earning
            individual.
          </em>
        </h5>
      </div>
      <div className="wrapper">
       <BasicDetail/>
        <div className="bank_details">
            <h4>Bank details</h4>
            <Input label="Account Holder Name"/>
            <Input label="Bank Name"/>
            <Input label="Account Number"/>
            <Input label="IFSC"/>
            <Input label="Branch Name"/>
        </div>
        <Address type='Current'/>

      </div>
    </div>
  );
};

export default Profile;
